pragma solidity 0.6.12;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "./interfaces/IGenNFTFactory.sol";

contract GenNFT is ERC721 {

    string public projectName;
    string public projectSymbol;

    IGenNFTFactory public factory;
    address public issuer;

    struct AirDrop{
        bool isAirDropped;
        uint256 id;
    }

    mapping(address => AirDrop) public getAirDoppedInfo;

    constructor (string memory _name, string memory _symbol, string memory _uri, IGenNFTFactory _factory, address _issuer) 
        public 
        ERC721(_name, _symbol)
    {
        projectName = _name;
        projectSymbol = _symbol;
        _setBaseURI(_uri);
        factory = _factory;
        issuer = _issuer;
    }

    function setBaseURI(string memory baseURI) external {
        require(msg.sender == issuer, "Only issuer is allowed to execute this function");
        _setBaseURI(baseURI);
    }

    function airDrop(address _to) external {
        require(!(getAirDoppedInfo[_to].isAirDropped), "User has already been air dropped");
        require(msg.sender == issuer, "Only issuer is allowed to air drop NFTs");

        uint mintIndex = totalSupply();
        bytes memory data;
        _safeMint(_to, mintIndex, data);
        getAirDoppedInfo[_to].isAirDropped = true;
        getAirDoppedInfo[_to].id = mintIndex;

    }

}
